def get_value(value):
    if "," not in value or "=" not in value:
        try:
            if "." in value:
                return float(value)
            else:
                return int(value)
        except ValueError:
            return value
    else:
        sub_dict = {}
        for item in value.split(","):
            k, v = item.rsplit("=", 1)
            sub_dict[k] = get_value(v)
